import React, { useState, useEffect } from "react";

const Event = (props) => {
  const [events, setEvents] = useState([]);

  useEffect(
    () => {
      fetch('/api/events').then(
        res => res.json()
        
      ).then(
        (events) => {
          console.log(events.events);
          setEvents(events);
        },
        function (error){
          console.log(error);
        }
      )
    },[]
  );
    return (
        <div className="container c-col">
        
        </div>
      );
};
export default Event;
